import React, { Component } from "react";

export class navbar extends Component {
  render() {
    return (
      <div>
        Total Unique Items :-
        <span className="badge badge-pill badge-secondary">
          {this.props.counters}
        </span>
      </div>
    );
  }
}

export default navbar;
